import React from "react";
import { Card } from "../../UI/Card.styled";
import Grid1 from "../../UI/Grid1";
import Grid2 from "../../UI/Grid2";
import Grid3 from "../../UI/Grid3";
const SectionOne = ({ content, styles }) => {
  return (
    <Card
      dp={"grid"}
      gridC={"40% 45% 15%"}
      mg={"0rem 2rem"}
      height={"20rem"}
      // bd={"1px solid red"}
    >
      <Grid1 styles={styles} content={content} />
      <Grid2 styles={styles} content={content} />
      <Grid3 styles={styles} content={content} />
    </Card>
  );
};

export default SectionOne;
